import React from 'react';

import axios from 'axios';

let config = {
  headers: { 
    'x-rapidapi-key': '65c02a4672mshf6ff63121b66145p1777adjsn6a125a20822d', 
    'x-rapidapi-host': 'alpha-vantage.p.rapidapi.com'},
  params: {
    function: 'GLOBAL_QUOTE', symbol: 'TSLA'
  },
}

var obj;
var response;
var symbol;
var myJSON;

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`https://alpha-vantage.p.rapidapi.com/query`, config)
      .then(res => {
        obj = res.data;
        response = obj[Object.keys(obj)[0]];
        symbol = symbol[Object.keys(response)[0]];
        symbol = JSON.stringify(symbol);  
        const persons = symbol;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul>
        { this.state.persons}
      </ul>
    )
  }
}
